package com.pauloweber.fibo.components;

import org.assertj.core.api.Assertions;
import org.junit.jupiter.api.Disabled;
import org.junit.jupiter.api.Test;
import org.springframework.core.io.ClassPathResource;

import java.io.File;
import java.io.IOException;
import java.math.BigInteger;
import java.nio.file.Files;

class FiboLogComponentTest {

    private final FiboLogComponent component = new FiboLogComponent();

    @Test
    void testNegative() {
        Assertions.assertThat(component.getFibo(-35)).isZero();
    }

    @Test
    void test0() {
        Assertions.assertThat(component.getFibo(0)).isZero();
    }

    @Test
    void test1() {
        Assertions.assertThat(component.getFibo(1)).isEqualTo(1);
    }

    @Test
    void test2() {
        Assertions.assertThat(component.getFibo(2)).isEqualTo(1);
    }

    @Test
    void test3() {
        Assertions.assertThat(component.getFibo(3)).isEqualTo(2);
    }

    @Test
    void test4() {
        Assertions.assertThat(component.getFibo(4)).isEqualTo(3);
    }

    @Test
    void test5() {
        Assertions.assertThat(component.getFibo(5)).isEqualTo(5);
    }

    @Test
    void test6() {
        Assertions.assertThat(component.getFibo(6)).isEqualTo(8);
    }

    @Test
    void test92() {
        Assertions.assertThat(component.getFibo(92)).isEqualTo(7540113804746346429L);
    }

    @Test
    void test249() {
        Assertions.assertThat(component.getFibo(249)).isEqualTo(new BigInteger("4880197746793002076754294951020699004973287771475874"));
    }

    @Test
    void test1500() {
        Assertions.assertThat(component.getFibo(1500)).isEqualTo(new BigInteger(""));
    }

    @Test
    void test10000() {
        Assertions.assertThat(component.getFibo(10000)).isEqualTo(new BigInteger(""));
    }

    @Test
    void test400000() {
        Assertions.assertThat(component.getFibo(400000)).isEqualTo(new BigInteger(new StringBuilder().append("").append("").toString()));
    }

    @Test
    void test4359127() throws IOException {
        File resource = new ClassPathResource("expected_4359127.txt").getFile();
        String expected = new String(Files.readAllBytes(resource.toPath()));
        Assertions.assertThat(component.getFibo(4359127)).isEqualTo(new BigInteger(expected));
    }

    @Test
    void test10000000() throws IOException {
        File resource = new ClassPathResource("expected_10000000.txt").getFile();
        String expected = new String(Files.readAllBytes(resource.toPath()));
        Assertions.assertThat(component.getFibo(10000000)).isEqualTo(new BigInteger(expected));
    }

    @Test
    @Disabled("This was disabled because it takes too long, it was created just out of curiosity to check the limits")
    void test21474836() throws IOException {
        File resource = new ClassPathResource("expected_21474836.txt").getFile();
        String expected = new String(Files.readAllBytes(resource.toPath()));
        Assertions.assertThat(component.getFibo(21474836)).isEqualTo(new BigInteger(expected));
    }
}